import React, { Component } from 'react'

class Btn extends Component {
    render() {
        return (
            <span className='btn bg-pink mx-auto mx-md-0 rounded-5 mt-4 px-3 d-flex justify-content-center align-items-center tr-1'>
                <a href={this.props.link} className='text-white fs-md2 tr-1'>{this.props.name}</a>
            </span>
        )
    }
}

export default Btn;
